import './App.css';
import SudokuGrid from './components/SudokuGrid';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Sudoku</h1>
        <SudokuGrid />
      </header>
    </div>
  );
}

export default App;
